import React from 'react';


const HomeStats = (data) => {

    const instance = data.props.hls.pstsg;
    console.log('home stats')
    console.log(instance);

    const mapPlayer = instance.map((player)=>
        <li key={player}>
            {player.fn}
        </li>
    )

    return (
        <div>
            <thead>
                <th>#</th>
                <th>Name</th>
                <th>Position</th>
            </thead>
            <tbody>

                <tr>
                    {mapPlayer}
                </tr>

            </tbody>
            <p>Players</p>
            <ul>{mapPlayer}</ul>
        </div>
    );
}

export default HomeStats;
